descriptor.controllerScript:
var requestTimeout = 500;
var requestPersistent = false;
var persistentPollingInterval = 5000;

self.onInit = function() {
    var subscription = self.ctx.defaultSubscription;
    var rpcEnabled = subscription.rpcEnabled;
    var deviceName = 'Simulated';
    var prompt;
    if (subscription.targetEntityName && subscription.targetEntityName.length) {
        deviceName = subscription.targetEntityName;
    }
    if (self.ctx.settings.requestTimeout) {
        requestTimeout = self.ctx.settings.requestTimeout;
    }
    if (self.ctx.settings.requestPersistent) {
        requestPersistent = self.ctx.settings.requestPersistent;
    }
    if (self.ctx.settings.persistentPollingInterval) {
        persistentPollingInterval = self.ctx.settings.persistentPollingInterval;
    }
    var greetings = 'Welcome to ThingsBoard RPC debug terminal.\n\n';
    if (!rpcEnabled) {
        greetings += 'Target device is not set!\n\n';
        prompt = '';
    } else {
        greetings += 'Current target device for RPC commands: [[b;#fff;]' + deviceName + ']\n\n';
        greetings += 'Please type [[b;#fff;]\'help\'] to see usage.\n';
        prompt = '[[b;#8bc34a;]' + deviceName +']> ';
    }

    var terminal = $('#device-terminal', self.ctx.$container).terminal(
        function(command) {
            if (command !== '') {
                try {
                    var localCommand = command.trim();
                    var requestUUID = uuidv4();
                    if (localCommand === 'help') {
                        printUsage(this);
                    } else {
                        var spaceIndex = localCommand.indexOf(' ');
                        if (spaceIndex === -1 && !localCommand.length) {
                            this.error("Wrong number of arguments!");
                            this.echo(' ');
                        } else {
                            var params;
                            if (spaceIndex === -1) {
                                spaceIndex = localCommand.length;
                            }
                            var name = localCommand.substr(0, spaceIndex);
                            var args = localCommand.substr(spaceIndex + 1);
                            if (args.length) {
                                try {
                                    params = JSON.parse(args);
                                } catch (e) {
                                    params = args;
                                }
                            }
                            performRpc(this, name, params, requestUUID);
                        }
                    }
                } catch(e) {
                    this.error(new String(e));
                }
            } else {
               this.echo('');
            }
        }, {
            greetings: greetings,
            prompt: prompt,
            enabled: rpcEnabled
    });

    if (!rpcEnabled) {
        terminal.error('No RPC target detected!').pause();
    }
}


function printUsage(terminal) {
    var commandsListText = '\n[[b;#fff;]Usage:]\n';
    commandsListText += '   <method> [params body]\n\n';
    commandsListText += '[[b;#fff;]Example 1:]\n'; 
    commandsListText += '   myRemoteMethod1 myText\n\n'; 
    commandsListText += '[[b;#fff;]Example 2:]\n'; 
    commandsListText += '   myOtherRemoteMethod "{\\"key1\\": 2, \\"key2\\": \\"myVal\\"}"\n'; 
    terminal.echo(new String(commandsListText));
}


function performRpc(terminal, method, params, requestUUID) {
    terminal.pause();
    self.ctx.controlApi.sendTwoWayCommand(method, params, requestTimeout, requestPersistent, persistentPollingInterval, requestUUID).subscribe(
        function success(responseBody) {
            terminal.echo(JSON.stringify(responseBody));
            terminal.echo(' ');
            terminal.resume();
        },
        function fail() {
            var errorText = self.ctx.defaultSubscription.rpcErrorText;
            terminal.error(errorText);
            terminal.echo(' ');
            terminal.resume();
        }
    );
}


function uuidv4() {
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
    var r = Math.random() * 16 | 0, v = c == 'x' ? r : (r & 0x3 | 0x8);
    return v.toString(16);
  });
}


self.onDestroy = function() {
    self.ctx.controlApi.completedCommand();
}
